import React from "react";

function Task() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-12">
          <div class="btn-group" role="group" aria-label="Basic example">
            <button type="button" class="btn btn-secondary">
              Left
            </button>
            <button type="button" class="btn btn-secondary">
              Middle
            </button>
            <button type="button" class="btn btn-secondary">
              Right
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Task;
